import React from 'react';
import Sidebar from '../components/Sidebar';
import PostsList from '../components/PostsList';

const Home = () => {
  return (
    <main className="container m-auto">
      <div className="flex mt-12">
        <div className="w-[300px]">
          <Sidebar />
        </div>
        <PostsList />
        <h1></h1>
      </div>
    </main>
  );
};

export default Home;
